import itertools
from scipy.spatial.distance import cdist
def interpolate_between_known_points(known_values, k_nearest):
    # Convert known values to a NumPy array
    known_values = np.array(known_values)

    # Initialize an empty list to store interpolated values
    interpolated_values = []

    # Compute pairwise distances between known points
    distances = cdist(known_values[:, :2], known_values[:, :2])

    # Iterate through combinations of indices to find the k nearest pairs
    pairs_indices = list(itertools.combinations(range(len(known_values)), 2))
    pairs_distances = distances[[*zip(*pairs_indices)]]

    # Find the indices of the k nearest pairs
    nearest_pairs_indices = np.argsort(pairs_distances)[:k_nearest]

    for idx in nearest_pairs_indices:
        i, j = pairs_indices[idx]
        x1, y1, rss1 = known_values[i]
        x2, y2, rss2 = known_values[j]

        # Calculate the average x value between x1 and x2
        x_interpolated = int((x1 + x2) / 2)

        # Calculate the average y value between y1 and y2
        y_interpolated = int((y1 + y2) / 2)

        # Calculate the interpolated RSS value based on the linear position
        rss_interpolated = rss1*0.5 + rss2*0.5

        # Add the interpolated point to the list
        interpolated_values.append([x_interpolated, y_interpolated, rss_interpolated])

    # Convert the list of interpolated values back to a NumPy array
    interpolated_values = np.array(interpolated_values)

    return interpolated_values





